import './App.css';
import './components/navBar/navBar';
import './components/card/card';
import './components/NewApp/NewApp';
import './components/languages/lang';
import './components/languages/lang';

function App() {
  return (
    <div>
      <NavBar
      item1='docs'
      item2='goods'
      item3='contacts'
      item4='cart'
      />
      <Card 
      url='https://flagcdn.com/w320/au.png'
      name='aus'
      capital='sydnei'
      lang='eng'
      currency='dollar'
      />
      <NewApp/>
      <Lang/>
    </div>
  );
}

export default App;
